import React from 'react';

import { Container } from './styles';

const Impact: React.FC = () => {
  return (
      <div className="body">
        <Container>
            <div className="text">
                <p>Our brand new and unparalleled community token distribution scheme</p>
                <h1>Become a Founding Member to earn < br/>
                     mainnet tokens and influence the < br/>
                     development of the platform.</h1>
            </div>
        </Container> 
      </div>

);
}

export default Impact;
